import React from "react";
import Navbar from "./components/Navbar";
import Grid from "@material-ui/core/Grid";
import { makeStyles } from "@material-ui/core/styles";
import Container from "@material-ui/core/Container";
import Box from "@material-ui/core/Box";
import { createMuiTheme } from "@material-ui/core/styles";
import Button from "@material-ui/core/Button";
import { Alert, AlertTitle } from "@material-ui/lab";
import "./App.css";
import Link from "@material-ui/core/Link";
import get from "./service/get";

import PlayArrowRoundedIcon from "@material-ui/icons/PlayArrowRounded";

const useStyles = makeStyles((theme) => ({}));

export default function Home() {
  const classes = useStyles();
  const theme = createMuiTheme({
    typography: {
      fontFamily: '"Prompt", serif',
    },
  });
  const [title, setTitle] = React.useState({
    tite: undefined,
  });
  const onSubmit = async () => {
    const result = await get();
    console.log(result);
    console.log(result[0].name);

    setTitle(...title, result[0].name);
    console.log(title);
  };

  return (
    <div className="container" theme={theme}>
      <div className="row">
        <Navbar />

        <Container maxWidth="sm" alignItems="center">
          <div className="box">
            <Container fixed>
              <Box paddingTop={20}>
                <Grid
                  container
                  direction="row"
                  justify="center"
                  alignItems="center"
                  spacing={1}
                >
                  <div>
                    <h2>แบบประเมินความสนใจของบุคคล</h2>
                    <h2 text-align="center">ที่มีต่องานราชการไทย</h2>
                  </div>
                  <Grid
                    container
                    direction="row"
                    justify="center"
                    alignItems="center"
                    spacing={1}
                  >
                    <div className={classes.root}>
                      <Grid
                        container
                        direction="row"
                        justify="center"
                        alignItems="center"
                        spacing={1}
                      >
                        <Grid
                          container
                          direction="row"
                          justify="center"
                          alignItems="center"
                          spacing={1}
                        >
                          <Grid>
                            <Container fixed>
                              <Box
                                p={4}
                                bgcolor="background.paper"
                                boxShadow={3}
                                spacing={2}
                              >
                                <div>
                                  &nbsp;
                                  &nbsp;&nbsp;&nbsp;สํานักงาน&nbsp;ก.พ.&nbsp;ร่วมกับ&nbsp;
                                  กรมการจัดหางาน&nbsp;กระทรวงแรงงาน&nbsp;
                                  พัฒนาแบบประเมินความสนใจของบุคคลที่มีต่องานราชการไทย&nbsp;
                                  โดยมีวัตถุประสงค์เพื่อเตรียมความพร้อมให้แก่ผู้สนใจสมัครเข้ารับราชการ&nbsp;
                                  ทุนรัฐบาล&nbsp;หรือประชาชนได้ทราบและนําข้อมูลเกี่ยวกับความถนัด&nbsp;
                                  ความสนใจ&nbsp;และบุคลิกภาพของตนเองไปใช้&nbsp;ในการตัดสินใจเลือกประกอบอาชีพได้อย่างมีประสิทธิภาพ&nbsp;
                                  ตลอดจนเตรียมความพร้อมในการประกอบอาชีพ
                                  ก่อนเข้าสู่ตลาดแรงงาน
                                </div>
                              </Box>
                            </Container>
                          </Grid>
                        </Grid>
                      </Grid>
                      <Grid
                        container
                        direction="row"
                        justify="center"
                        alignItems="center"
                        spacing={1}
                      >
                        <Box p={2} spacing={2}>
                          <Alert severity="info">
                            <AlertTitle>Info</AlertTitle>
                            <h4>
                              <strong>
                                &nbsp; &nbsp; &nbsp; &nbsp;แบบประเมินฯ มีทั้งหมด
                                87 ข้อ&nbsp;
                                ท่านต้องตอบแบบประเมินฯ&nbsp;ให้ครบทุกข้อใช้เวลาทั้งหมดประมาณ
                                15 นาที หากท่านต้องการพิมพ์ผลการประเมินฯ
                                โปรดเตรียมเครื่องพิมพ์ให้เรียบร้อยก่อนเริ่มทําแบบประเมินฯ
                                หรือใช้เว็บเบราวเซอร์ที่สามารถพิมพ์เป็นเอกสาร
                                &nbsp;PDF &nbsp;ได้
                              </strong>
                            </h4>
                          </Alert>
                        </Box>
                      </Grid>

                      <Grid
                        container
                        direction="row"
                        justify="center"
                        alignItems="center"
                        spacing={4}
                      >
                        <button onClick={onSubmit}>click</button>
                        <Box p={2} spacing={2}>
